      let plusOrMinus = Math.random() < 0.5 ? -1 : 1;
      anime({
        targets: cloud,
        translateX: (Math.floor(Math.random() * 300) + 200) * plusOrMinus,
        duration: (Math.floor(Math.random() * 1000) + 5000),
        loop: true,
        direction: 'alternate',
        easing: 'linear'
      })
    })

    anime({
      targets: "#smoke-1",
      translateY: -400,
      opacity: 0.1,
      duration: 2000,
      easing: 'linear',
      loop: true
    })
    anime({
      targets: "#smoke-2",
      translateY: -200,
      opacity: 0.1,
      duration: 2000,
      easing: 'linear',
      loop: true,
      delay: 100
    })

    let textAnimation = anime.timeline({
      delay: 1000,
      duration: 500,
      easing: 'linear'
    });
    textAnimation
      .add({
        targets: '.text-box',
        delay: 1000,
        duration: 1000,
        opacity: 0.9,
      })
      .add({
        targets: '#para-1',
        color: '#000'
      })
      .add({
        targets: '#para-2',
        color: '#000'
      })
      .add({
        targets: '#para-3',
        color: '#000'
      })
      .add({
        targets: '#para-4',
        color: '#000'
      })
      .add({
        targets: '#para-5',
        color: '#000'
      })
  }
}
